         no: 'Du godtok ikke bruk av informasjonskapsler basert på våre <a target="_blank" href="%(url)s">regler for informasjonskapsler</a>. Godta bruk av informasjonskapsler hvis du vil aktivere chattefunksjonene.',
         fil: 'Hindi ka sumunod sa paggamit ng cookies batay sa aming <a target="_blank" href="%(url)s">patakaran sa cookie</a>. Aprubahan ang paggamit ng cookies upang mapagana ang mga function ng Chat.',
         ar: 'لقد اعترضت على استخدام ملفات الارتباط بناءً على <a target="_blank" href="%(url)s">سياسة ملفات الارتباط</a> الخاصة بنا. وافق على استخدام ملفات الارتباط لتمكين وظائف Chat.',
         ja: 'あなたは、当社の<a target="_blank" href="%(url)s">cookieポリシー</a>に基づくcookieの使用に同意されませんでした。cookieの使用を承認して、チャット機能を有効にしてください。',
         ko: 'Zendesk의 <a target="_blank" href="%(url)s">쿠키 정책</a>에 따른 쿠키 사용을 거부하셨습니다. Chat 기능을 사용하려면 쿠키 사용을 승인하세요.',
         sl: 'Ugovarjali ste uporabi piškotkov na podlagi naše <a target="_blank" href="%(url)s">politike piškotkov</a>. Potrdite uporabo piškotkov, da omogočite funkcije Klepeta.',
         hr: 'Niste se složili s upotrebom kolačića prema našim <a target="_blank" href="%(url)s">pravilima o upotrebi kolačića</a>. Dopustite upotrebu kolačića kako biste omogućili funkcije chata.',
         id: 'Anda berkeberatan atas penggunaan cookie berdasarkan <a target="_blank" href="%(url)s">kebijakan cookie</a> kami. Setujui penggunaan cookie untuk mengaktifkan fungsi Chat.',
         cs: 'Nesouhlasili jste s používáním souborů cookie podle našich <a target="_blank" href="%(url)s">zásad používání souborů cookie</a>. Abyste umožnili používání funkcí chatu, povolte používání souborů cookie.',
         th: 'คุณคัดค้านการใช้คุกกี้ตาม <a target="_blank" href="%(url)s">นโยบายเกี่ยวกับคุกกี้</a> ของเรา โปรดอนุมัติการใช้คุกกี้เพื่อเปิดใช้งานฟังก์ชันการแชท',
         fi: 'Vastustit evästeiden käyttöä <a target="_blank" href="%(url)s">evästekäytäntömme perusteella</a>. Hyväksy evästeiden käyttö ottaaksesi käyttöön chattitoiminnot.',
         tr: '<a target="_blank" href="%(url)s">Çerez politikamıza</a> dayanan çerez kullanımını reddettiniz. Chat işlevlerini etkinleştirmek için çerez kullanımını onaylayın.',
         sv: 'Du hade invändningar mot användningen av cookies baserat på vår <a target="_blank" href="%(url)s">cookiepolicy</a>. Godkänn användningen av cookies om du vill aktivera chattfunktionerna.',
         el: 'Αρνηθήκατε τη χρήση cookies, σύμφωνα με την <a target="_blank" href="%(url)s">πολιτική μας για τα cookies</a>. Εγκρίνετε τη χρήση cookies για να ενεργοποιήσετε τις λειτουργίες συνομιλίας.',
         bg: 'Посочихте, че не сте съгласни с употребата на бисквитки съгласно <a target="_blank" href="%(url)s">политиката ни относно използването на бисквитки</a>. За да активирате функциите на Chat, одобрете употребата на бисквитки.',
         et: 'Te keeldusite küpsiste kasutamisest meie <a target="_blank" href="%(url)s">küpsiste poliitika</a> alusel. Kinnitage küpsiste kasutamine vestluse funktsioonide lubamiseks.',
         da: 'Du havde indvendinger mod brugen af cookies baseret på vores <a target="_blank" href="%(url)s">cookie-politik</a>. Godkend brugen af cookies for at aktivere Chat-funktioner.',
         sk: 'Odmietli ste povoliť súbory cookie v súlade s našimi <a target="_blank" href="%(url)s">zásadami používania súborov cookie</a>. Ak chcete používať funkcie Chatu, povoľte používanie súborov cookie.',
         nl: 'Op basis van ons <a target="_blank" href="%(url)s">cookiebeleid</a> hebt u bezwaar gemaakt tegen het gebruik van cookies. Ga akkoord met het gebruik van cookies om de chatfunctie in te schakelen.',
         bs: 'You objected to the use of cookies based on our <a target="_blank" href="%(url)s">cookie policy</a>. Approve the use of cookies to enable Chat functions.',
         hu: 'Ön kifogásolta a cookie-knak a <a target="_blank" href="%(url)s">cookie-kra vonatkozó szabályzatunk</a> szerinti használatát. Hagyja jóvá a cookie-k használatát a Chat funkcióinak engedélyezéséhez.',
         pt: 'Você negou o uso de cookies com base em nossa <a target="_blank" href="%(url)s">política de cookies</a>. Aprove o uso de cookies para ativar as funções do Chat.',
         fa: 'You objected to the use of cookies based on our <a target="_blank" href="%(url)s">cookie policy</a>. Approve the use of cookies to enable Chat functions.',
         ca: "Us heu oposat a l'ús de galetes d'acord amb la nostra <a target=\"_blank\" href=\"%(url)s\">política de galetes</a>. Per tal d'activar les funcions del xat, aproveu l'ús de galetes.",
         lt: 'Nesutikote naudoti slapukų pagal mūsų <a target="_blank" href="%(url)s">slapukų politiką</a>. Norėdami įjungti pokalbio funkcijas, patvirtinkite slapukų naudojimą.',
         lv: 'Jūs iebildāt pret sīkdatņu izmantošanu atbilstoši mūsu <a target="_blank" href="%(url)s">sīkdatņu politikai</a>. Apstipriniet sīkdatņu izmantošanu, lai nodrošinātu tērzēšanas darbību.',
         sr: 'Protivili ste se upotrebi kolačića zasnovanih na našoj <a target="_blank" href="%(url)s">politici o kolačićima</a>. Odobrite upotrebu kolačića kako biste omogućili funkcije ćaskanja.',
         uk:
          'Ви заперечуєте проти використання файлів cookie, що здійснюється відповідно до нашої <a target="_blank" href="%(url)s">політики використання файлів cookie</a>. Затвердити використання файлів cookie для ввімкнення функцій чату.',
